            class ParallelEventContainer {
              constructor(events) {
                this.events = events;
                this.status = events.map((e) => false);
                this.base_elapsed = undefined;
              }

              process_event(elapsed) {
                if (this.base_elapsed === undefined)
                  this.base_elapsed = elapsed;

                const event_elapsed = elapsed - this.base_elapsed;

                this.events.forEach((event, idx) => {
                  if (!this.status[idx])
                    this.status[idx] = event.process_event(event_elapsed);
                });

                return this.status.reduce((prev, curr) => prev && curr);
              }

              undo() {
                this.status = this.events.map(() => false);
                this.base_elapsed = undefined;
                this.events.forEach(e => e.undo());
              }
            }

            class SequentialEventContainer {
              constructor(events) {
                this.events = events;
                this.base_elapsed = undefined;
                this.idx = 0;
              }

              process_event(elapsed) {
                if (this.base_elapsed === undefined)
                  this.base_elapsed = elapsed;

                if (this.idx < this.events.length) {
                  const event_elapsed = elapsed - this.base_elapsed;
                  const finished = this.events[this.idx].process_event(event_elapsed);
                  if (finished) {
                    this.base_elapsed = undefined;
                    this.idx++
                  }
                }

                return this.idx >= this.events.length
              }

              undo() {
                this.base_elapsed = undefined;
                this.idx = 0;
                this.events.forEach(e => e.undo());
              }
            }

            class PathEvent {
              constructor(path) {
                this.path = path;
                this.length = path.getTotalLength();
                this.total_time = this.length / 0.8;
              }

              // Draws paths on the screen based on time elapsed and draw speed.
              // Returns true if the path has been drawn entirely.
              process_event(elapsed) {
                const percentage = elapsed/this.total_time;
                const progress = Math.min(1, percentage);
                this.path.style.strokeDashoffset = Math.floor(this.length * (1 - progress));
                return progress === 1;
              }

              // Clears the path from screen
              clear_from_screen() {
                this.path.style.strokeDasharray = this.length + " " + this.length;
                this.path.style.strokeDashoffset = this.length;
              }

              undo() {
                this.clear_from_screen();
              }
            }

            class CameraEvent {
              constructor(old_cam, new_cam, duration, root) {
                this.old_cam = old_cam;
                this.new_cam = new_cam;
                this.duration = duration;
                this.root = root;
              }

              process_event(elapsed) {
                if (this.duration === 0) {
                  this.root.setAttribute("viewBox", this.new_cam.join(" "));
                  return true;
                }
                const progress = Math.min(1, elapsed / this.duration);
                const total_delta = this.new_cam.map((n, idx) => n - this.old_cam[idx]);
                const cam = this.old_cam.map((n, idx) => n + progress * total_delta[idx])
                this.root.setAttribute("viewBox", cam.join(" "));
                return progress === 1;
              }

              undo() {
                if (typeof this.old_cam !== "undefined")
                  this.root.setAttribute("viewBox", this.old_cam.join(" "));
              }

            if (finished) {
              window.cancelAnimationFrame(handle);
              listen_to_kb = true;
              event_idx++;
              last_timestamp = undefined
              return;
            }
            handle = window.requestAnimationFrame(next_frame);
          }

          function undo_last_event() {
            if (event_idx == 0)
              return;
            event_idx--;
            event_list[event_idx].undo();
          }

          document.addEventListener('keydown', (event) => {
            if (listen_to_kb == false)
              return;
            switch (event.key) {
              case "Down": // IE/Edge
              case "ArrowDown":
              case "Right": // IE/Edge
              case "ArrowRight":
              case "Enter":
              case " ":
                listen_to_kb = false
                handle = window.requestAnimationFrame(next_frame);
                return;
              case "Up": // IE/Edge
              case "ArrowUp":
              case "Left": // IE/Edge
              case "ArrowLeft":
                listen_to_kb = false;
                undo_last_event();
                listen_to_kb = true;
                return;
              default:
                return;
            }
          }, false);

          function pointerdown_handler(event) {
            if (!listen_to_kb || !event.isPrimary)
              return;
            const svg_width = svg_root.clientWidth;
            if (event.clientX > .7 * svg_width) {
              listen_to_kb = false
              handle = window.requestAnimationFrame(next_frame);
            }
            else if (event.clientX < .3 * svg_width) {
                listen_to_kb = false;
                undo_last_event();
                listen_to_kb = true;
            }
          }
          svg_root.onpointerdown = pointerdown_handler;
window.requestAnimationFrame(next_frame)
</script>
